import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
    profile: {
        backgroundImage: 'linear-gradient(#FFE00D , #FEA127)',
        height: '700px',
        display: 'flex',
        flexDirection: 'column !important',
        boxShadow: '0px 0px 70px rgba(0, 0, 0, 0.3)',
        borderRadius: '12px',
    },
    profileSVG: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-end',
        justifyContent: 'flex-end',
        alignContent: 'flex-end',
        height: '100%',
    },
    profilePic: {
        position: 'absolute'
    },
    profilePicture: {
        display: 'flex',
        justifyContent: 'center',
        marginTop: '66px',
        zIndex: 3
    },
    profileText: {
        zIndex: 99,
        textAlign: 'center',
        marginTop: 390,
        position: 'absolute',

    },
    profileTextParent: {
        width: '100%'
    },
    profileButtons: {
        "& > *": {
            marginRight: '20px !important',
            textAlign: 'center',
        },
        "&>:nth-child(1)": {
            color: 'white',
            background: 'linear-gradient(#fd8590 0%, #fc364a 100%) !important',
            filter: 'drop-shadow(0px 16px 24px rgba(252, 59, 78, 0.24)) !important',
            borderRadius:198,
            padding:10

        }

    }
});
export default useStyles;
